export default function Square({ value, onSquareClick }) {
  const color = value
    ? value > 0
      ? "var(--primary_C)"
      : "var(--secondary_C)"
    : "black";

  return (
    <button className="square" onClick={onSquareClick} style={{ color }}>
      <span>{value ? (value > 0 ? "X" : "O") : ""}</span>
      <span></span>
      <span></span>
    </button>
  );
}
